class TransactionHashBuilderTest {

    void testFromBase64Payload(String expectedOutputBase64, String inputBase64) throws Exception {
        byte[] expectedOutputRaw = Encode.fromBase64String(expectedOutputBase64);

        InteractiveSubmissionServiceOuterClass.PreparedTransaction preparedTransaction = Ledger.parseTransaction(inputBase64);
        byte[] actualOutputRaw = new TransactionHashBuilder(preparedTransaction).hash();

        if (!Arrays.equals(expectedOutputRaw, actualOutputRaw)) {
            String base64ComputedHash = Encode.toBase64String(actualOutputRaw);
            throw new IllegalStateException("Transaction hash mismatch: %s (expected) vs %s (computed) for transaction %s%nraw: %s"
                    .formatted(expectedOutputBase64, base64ComputedHash, inputBase64, preparedTransaction.toString()));
        }
    }

    @Test
    void minimumComplianceTest() throws Exception {
        // this unit test is replicated from the wallet SDK
        testFromBase64Payload("f97Cv1BO7QS7jmSY03p56JGsPf60Vx/ABXmRub7iiQI=", "");
    }

    @Test
    void externallySignedTokenStandardTransfer() throws Exception {
        // illustrates successful signing of a token standard transfer
        testFromBase64Payload("Ny7g8WpF8KgprjvxjFVwwKHq/TTd9jFOrc11yyan39A=", "");
    }
}